The '''Baby impling''' is an [[impling]] that can be caught in the [[Impetuous Impulses]] [[minigame]], and is located throughout [[Puro-Puro]] and [[Gielinor]]. The player needs at least 17 [[Hunter]] to capture this type of impling with a [[butterfly net]] or a [[magic butterfly net]], or 27 Hunter barehanded.

In Puro-Puro, a net and empty jars are '''required''' to catch any implings.

In Gielinor, they can also be caught barehanded or while wielding any item, with or without an empty [[impling jar]]. Without an empty jar the player will immediately receive the loot from the impling, instead of the impling itself.

Once these requirements have been met the player simply needs to click on the impling, and the character will attempt to catch it, though there is a chance of failure, in which case the character will continue trying to do so until it is caught. [[Bind]], [[Snare]], and [[Entangle]] can be cast on implings to prevent them from moving for different periods of time.

When the impling is finally jarred the player can either trade with [[Elnock Inquisitor]] or can free the baby impling from the [[Baby impling jar]], which will leave an item behind. By trading with Elnock, the player can either get 3 [[impling jar]]s for one baby impling jar, or, with 2 [[young impling]]s and 1 [[gourmet impling]], can get a can of [[imp repellent]]. Capturing a baby impling will grant the player either 18 (if caught on [[Puro-Puro]]) or 20 (if caught on ''RuneScape'') [[Hunter]] experience.

Many players ignore these implings when encountered, even if they have the Hunter level to catch them, for obvious reasons related to the poor value of their drops. However, when a baby or [[young impling]] is allowed to continue without being caught, the respective spawn point will not generate a new impling until it is caught. Players looking for rarer implings would do well to catch any low level implings they see in order to encourage the spawning of higher level implings. The reverse is also true, that catching only higher level implings will result in mainly low level implings wandering around largely ignored.

There is a guaranteed respawn point in each of the four corners of the Puro-Puro maze, making them a viable target for training low level Hunter skill.

