==Loot==
At current [[Grand Exchange]] prices, opening a baby impling jar gives {{Coins|{{ImpValue|baby|jar=yes}} round 0}} worth of loot, on average. This means opening baby impling jars marks an average profit of {{Coins|{{ImpValue|baby|jar=yes}}-{{GEP|Baby impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|100*({{ImpValue|baby|jar=yes}}-{{GEP|Baby impling jar}}) round 0}} to get an [[clue scroll (easy)|easy clue scroll]], and {{Coins|50*({{ImpValue|baby|jar=yes}}-{{GEP|Baby impling jar}}) round 0}} to get a [[clue scroll (beginner)|beginner clue scroll]] from baby impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

